$.initcity = function(defaultAddr,sheng, shi, qu) {
	// 省
	var cities = cityDirectory;
	var shengOp = "<option value=''>请选择省</option>";
	for (var i = 0; i < cities.length; i++) {
		if (cities[i][3] == 1) {
			var s = cities[i][0] == defaultAddr.sheng ? "selected='selected'"
					: '';
			shengOp += "<option " + s + " value='" + cities[i][0] + "' data='"
					+ cities[i][4] + "'>" + cities[i][0] + "</option>";
		}
	}
	sheng.html(shengOp);
	// 市
	sheng.change(function() {
		if(shi==null){
			return;
		}
		var shengcode = $(this).find("option:selected").attr("data");
		var shiop = "<option value=''>请选择市</option>";
		for (var i = 0; i < cities.length; i++) {
			if (cities[i][3] == 2 && cities[i][4].indexOf(shengcode) == 0) {
				var s = cities[i][0] == defaultAddr.shi ? "selected='selected'"
						: '';
				shiop += "<option " + s + " value='" + cities[i][0]
						+ "' data='" + cities[i][4] + "'>" + cities[i][0]
						+ "</option>";
			}
		}
		shi.html(shiop);
		shi.change();
	});
	shi.change(function() {
		if(qu==null){
			return;
		}
		var shicode = $(this).find("option:selected").attr("data");
		var quop = "<option value=''>请选择区</option>";
		for (var i = 0; i < cities.length; i++) {
			if (cities[i][3] == 3 && cities[i][4].indexOf(shicode) == 0) {
				var s = cities[i][0] == defaultAddr.qu ? "selected='selected'"
						: '';
				quop += "<option " + s + " value='" + cities[i][0] + "' data='"
						+ cities[i][4] + "'>" + cities[i][0] + "</option>";
			}
		}
		qu.html(quop);
		qu.change();
	});
	sheng.change();
};

